import React from "react";
const Welcome = (props) => {
  return(
    <div>
      <h2>Welcome {props.name}</h2>
      </div>
  )
}

function App(){
  return(
    <div>

      <h1>Welcome to React App
        <h2>@dayannaold</h2>
      </h1>
    </div>
  )
}
